import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <div style={{ paddingTop: '65px' }} className="row">
        <div className="col bg-danger">
          <h2 className="Get-started-with-Flyout-today text-center">
            Get started with Flyout today
          </h2>

          <p
            style={{ marginTop: '16px' }}
            className="Flyout-is-a-free text-center"
          >
            Flyout is a free, simple way to earn money by placing sponsored
            content on your blog.
          </p>

          <div style={{ marginTop: '40px' }} className=" d-flex flex-row">
            <a className="btn buttonsprimary" href="/">
              {' '}
              Get Started
            </a>

            <a
              style={{ marginLeft: '27px' }}
              className="btn btn-outline buttonssecondary"
              href="/"
            >
              {' '}
              Join Flyout Community
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
